parts.text:
[
  {
    "id": "app-window-title-bar",
    "type": "window-title-bar",
    "text": "Sem título 1 — LibreOffice Writer",
    "region": "top-bar",
    "meta": {
      "appName": "LibreOffice Writer",
      "documentName": "Sem título 1"
    }
  },
  {
    "id": "app-menu-bar",
    "type": "menu-bar",
    "region": "top-bar",
    "text": "Menu Principal",
    "meta": {
      "items": [
        "Arquivo",
        "Editar",
        "Exibir",
        "Inserir",
        "Formatar",
        "Estilos",
        "Tabela",
        "Formulário",
        "Ferramentas",
        "Janela",
        "Ajuda"
      ]
    }
  },
  {
    "id": "app-toolbar-standard",
    "type": "toolbar",
    "region": "top-bar",
    "meta": {
      "items": [
        {"type": "icon-button", "label": "Novo"},
        {"type": "icon-button", "label": "Abrir"},
        {"type": "icon-button", "label": "Salvar"},
        {"type": "icon-button", "label": "Imprimir"},
        {"type": "icon-button", "label": "Visualizar impressão"},
        {"type": "icon-button", "label": "Recortar"},
        {"type": "icon-button", "label": "Copiar"},
        {"type": "icon-button", "label": "Colar"},
        {"type": "icon-button", "label": "Desfazer"},
        {"type": "icon-button", "label": "Refazer"}
      ]
    }
  },
  {
    "id": "app-toolbar-formatting",
    "type": "toolbar",
    "region": "top-bar",
    "meta": {
      "items": [
        {"id": "style-dropdown", "type": "select", "text": "Estilo de parágrafo Padrão", "actions": ["onChange"]},
        {"id": "font-family-dropdown", "type": "select", "text": "Arial", "actions": ["onChange"]},
        {"id": "font-size-dropdown", "type": "select", "text": "12 pt", "actions": ["onChange"]},
        {"id": "bold-button", "type": "button", "text": "N", "meta": {"style": "bold"}, "actions": ["onClick"]},
        {"id": "italic-button", "type": "button", "text": "I", "meta": {"style": "italic"}, "actions": ["onClick"]},
        {"id": "underline-button", "type": "button", "text": "S", "meta": {"style": "underline"}, "actions": ["onClick"]},
        {"id": "strikethrough-button", "type": "button", "text": "S", "meta": {"style": "strikethrough"}, "actions": ["onClick"]},
        {"id": "superscript-button", "type": "button", "text": "A", "meta": {"style": "superscript"}, "actions": ["onClick"]},
        {"id": "subscript-button", "type": "button", "text": "A", "meta": {"style": "subscript"}, "actions": ["onClick"]},
        {"id": "font-color-button", "type": "button", "text": "A", "meta": {"action": "open-font-color-picker"}, "actions": ["onClick"]},
        {"id": "highlight-color-button", "type": "button", "text": "A", "meta": {"action": "open-highlight-color-picker"}, "actions": ["onClick"]},
        {"id": "clear-formatting-button", "type": "button", "text": "T", "meta": {"action": "clear-direct-formatting"}, "actions": ["onClick"]},
        {"id": "align-left-button", "type": "button", "meta": {"alignment": "left"}, "actions": ["onClick"]},
        {"id": "align-center-button", "type": "button", "meta": {"alignment": "center"}, "actions": ["onClick"]},
        {"id": "align-right-button", "type": "button", "meta": {"alignment": "right"}, "actions": ["onClick"]},
        {"id": "justify-button", "type": "button", "meta": {"alignment": "justify"}, "actions": ["onClick"]}
      ]
    }
  },
  {
    "id": "app-ruler-horizontal",
    "type": "ruler",
    "region": "main-content",
    "meta": {
      "orientation": "horizontal"
    }
  },
  {
    "id": "app-document-editor",
    "type": "document-editor",
    "region": "main-content",
    "state": "inactive"
  },
  {
    "id": "app-sidebar",
    "type": "sidebar",
    "region": "right-sidebar",
    "state": "collapsed",
    "meta": {
      "icons": [
        {"label": "Propriedades", "type": "icon"},
        {"label": "Estilos", "type": "icon"},
        {"label": "Galeria", "type": "icon"},
        {"label": "Navegador", "type": "icon"}
      ]
    }
  },
  {
    "id": "app-status-bar",
    "type": "status-bar",
    "region": "footer",
    "meta": {
      "items": [
        {"type": "text", "text": "Página 1 de 1"},
        {"type": "text", "text": "0 palavra, 0 caractere"},
        {"type": "text", "text": "Estilo de página Padrão"},
        {"type": "text", "text": "Português (Brasil)"},
        {"type": "zoom-control", "text": "100%", "actions": ["onZoomChange"]}
      ]
    }
  },
  {
    "id": "signature-line-modal",
    "type": "modal",
    "text": "Linha de assinatura",
    "state": "active",
    "region": "center",
    "meta": {
      "title": "Linha de assinatura"
    }
  },
  {
    "id": "modal-title-bar-close",
    "type": "icon-button",
    "text": "Fechar",
    "region": "modal-title-bar",
    "actions": ["onClick"]
  },
  {
    "id": "modal-title-bar-maximize",
    "type": "icon-button",
    "text": "Maximizar",
    "region": "modal-title-bar",
    "actions": ["onClick"]
  },
  {
    "id": "modal-title-bar-minimize",
    "type": "icon-button",
    "text": "Minimizar",
    "region": "modal-title-bar",
    "actions": ["onClick"]
  },
  {
    "id": "header-signatario-sugerido",
    "type": "header",
    "text": "Signatário sugerido",
    "region": "modal"
  },
  {
    "id": "label-nome",
    "type": "label",
    "text": "Nome:",
    "region": "modal",
    "meta": {
      "associatedInput": "input-nome"
    }
  },
  {
    "id": "input-nome",
    "type": "input",
    "text": "jose da silva",
    "state": "filled",
    "region": "modal",
    "actions": ["onChange"]
  },
  {
    "id": "label-titulo",
    "type": "label",
    "text": "Título:",
    "region": "modal",
    "meta": {
      "associatedInput": "input-titulo"
    }
  },
  {
    "id": "input-titulo",
    "type": "input",
    "text": "diretor",
    "state": "filled",
    "region": "modal",
    "actions": ["onChange"]
  },
  {
    "id": "label-email",
    "type": "label",
    "text": "E-mail:",
    "region": "modal",
    "meta": {
      "associatedInput": "input-email"
    }
  },
  {
    "id": "input-email",
    "type": "input",
    "text": "silva@silva.com",
    "state": "filled, focused",
    "region": "modal",
    "actions": ["onChange"]
  },
  {
    "id": "header-mais",
    "type": "header",
    "text": "Mais",
    "region": "modal"
  },
  {
    "id": "checkbox-anotacoes",
    "type": "checkbox",
    "text": "Signatário pode adicionar anotações",
    "state": "checked",
    "region": "modal",
    "actions": ["onClick"]
  },
  {
    "id": "checkbox-data-assinatura",
    "type": "checkbox",
    "text": "Mostrar data da assinatura na linha de assinatura",
    "state": "checked",
    "region": "modal",
    "actions": ["onClick"]
  },
  {
    "id": "label-instrucoes",
    "type": "label",
    "text": "Instruções para o signatário:",
    "region": "modal",
    "meta": {
      "associatedInput": "textarea-instrucoes"
    }
  },
  {
    "id": "textarea-instrucoes",
    "type": "textarea",
    "text": "",
    "state": "empty",
    "region": "modal",
    "actions": ["onChange"]
  },
  {
    "id": "button-ajuda",
    "type": "button",
    "text": "Ajuda",
    "region": "modal-footer",
    "actions": ["onClick"]
  },
  {
    "id": "button-ok",
    "type": "button",
    "text": "OK",
    "state": "primary",
    "region": "modal-footer",
    "actions": ["onClick"]
  },
  {
    "id": "button-cancelar",
    "type": "button",
    "text": "Cancelar",
    "region": "modal-footer",
    "actions": ["onClick"]
  }
]
